import React from "react";
import Text from "./Text";
const App = () => {
  return (
    <React.Fragment>
      <h1>Hi, I am react</h1>
      <Text name="Hadi" />
      <Text name="Ali" />
      <Text />
      <Text />
      <Text />
    </React.Fragment>
  );
};

export default App;
